window.bookSummaryJSON = "<p>Alexander and the Greystone Guild are expanding their territory. Building up the keep, conquering new lands, and recruiting citizens of all races. And when they've prepared enough, they plan on taking the fight to the minions of the Dark One in their own strongholds.</p> <p>New friends are discovered, and alliances are made. Tragedy befalls one of the group, and the Dark One's identity is finally discovered. A new yet, at the same time, ancient enemy makes itself known, threatening to change the face of Io forever. </p> <p>This is the third installment in the Greystone Chronicles.</p>"; 
